import React from 'react';

// Modules import
import Header from './modules/header';
import Body from './modules/body';
import Footer from './modules/footer';

function App() {
  return (
    <div className="app">
      <Header />
      <Body />
      <Footer />
    </div>
  );
}

export default App;
